import React from 'react';
import './modal.css';

class Modal extends React.Component {
    render() {
        return (
            <div className="modalContainer">
                <div className="content">
                    <form>
                        <h5 class="modalContainerHeading">Are you a sportsperson? Wanna hear the latest news in the sports world? Wait no more and subscribe
                        </h5>
                        <input type="text" placeholder="Name" id="fname" name="fname" />
                        <input type="text" placeholder="Email" id="em" name="em" />
                        <input type="submit" placeholder="Subscribe" />
                    </form>
                </div>
            </div>

        );
    }
}
export default Modal;
